import React from 'react';
import logo from '../../Icons/logo.png'
import creo from '../../Icons/creatives.png'

interface Props {
	id: string;
}

export const Img = ({ id }: Props) => {

	switch (id) {
		case 'leftBarLogo':
			return (

				<div>
					<img src={logo} alt="Reliz-logo" />
				</div>

			)


			case 'creo_folder':
			return (

				<div>
					<img src={creo} alt="creo" />
				</div>

			)


			default:
				return <img></img>;
	


			}
	}
